import React from 'react'
import styled from 'styled-components'
import MenuIcon from '@mui/icons-material/Menu';

function Header() {
    return (
        <Container>
            <a>
                <img src="/images/logo.svg"/>
            </a>
        <Menu>
        <a href='#'>Model S</a>
        <a href='#'>Model 3</a>
        <a href='#'>Model X</a>
        <a href='#'>Model Y</a>
        </Menu>
        <RightMenu>
            <a href='#'>Shop</a>
            <a href='#'>Tesla Account</a>
            <CustomMenu />
        </RightMenu>
        <BurgerMenu>
            <h3>Clone by Shreyash</h3>
            <li><a href='#'>About</a></li>
            <li><a href='#'>About</a></li>
            <li><a href='#'>About</a></li>
        </BurgerMenu>
        </Container>

    )
}

export default Header

const Container = styled.div`
        min-height:60px;
        position:fixed;
        display:flex;
        align-items:center;
        padding:0 20px;
        width:100%;
        justify-content:space-between;
        z-index:1;
        // top:0;
        // left:0;
        // right:0;
`
const Menu = styled.div`
        display:flex;
        align-items:center;
        flex:1;
        justify-content:center;
        a{
            font-weight:600;
            text-transform:uppercase;
            padding:0 10px;
            flex-wrap:nowrap;
        }
        @media (max-width:768px){
            display:none;
        }

`
const RightMenu = styled.div`
        display:flex;
        align-items:center;
        a{
            font-weight:600;
            text-transform:uppercase;
            margin:10px;
            flex-wrap:nowrap;
        }
`
const CustomMenu = styled(MenuIcon)`
        cursor:pointer;
`

const BurgerMenu = styled.div`
        position:fixed;
        top:0;
        bottom:0;
        right:0;
        background:white;
        width:300px;
        z-index:15;
        list-style:none;
        padding:20px;
        display:flex;
        flex-direction:column;
        text-align:start;
        justify-content:flex-start;
        li{
            padding:15px 0px;
            border-bottom:solid rgba(0,0,0,0.2)

            // a{
            //     font-weight:600;

            // }
        }


`
